import AC02 from "../AboutComp/AC02";
import AC03 from "../AboutComp/AC03";
import AC04 from "../AboutComp/AC04";

const ACard01 = () => {
    return ( 
        <>
            <div className="titles">
                <h1>Meet The Team</h1>
                <AC01 />
                <AC02 />
                <AC03 />
                <AC04 />
            </div>
        </>
     );
}
 
export default ACard01;
